func countSubarrays(nums []int, k int) int64 {
    var count int64 = 0
    n := len(nums)

    for i := 0; i < n; i++ {
        maxNum := nums[i]
        freq := 1
        if freq >= k {
            count++
        }
        for j := i - 1; j >= 0; j-- {
            if nums[j] > maxNum {
                maxNum = nums[j]
                freq = 1
            } else if nums[j] == maxNum {
                freq++
            }
            if freq >= k {
                count++
            }
        }
        maxNum = nums[i]
        freq = 1
        for j := i + 1; j < n; j++ {
            if nums[j] > maxNum {
                break
            }
            if nums[j] == maxNum {
                freq++
                if freq >= k {
                    count += int64(j - i)
                }
            }
        }
    }

    return count
}
